import React, { useCallback, useState } from "react";
import { useDropzone } from "react-dropzone";
import { storage, db } from "./firebase";
import {
  addDoc,
  arrayUnion,
  collection,
  serverTimestamp,
  updateDoc,
} from "firebase/firestore";
import { ref, getDownloadURL, uploadBytes } from "@firebase/storage";

export default function Predict() {
  const [selectedImage, setSelectedImage] = useState([]);

  const uploadPost = async () => {
    const docRef = await addDoc(collection(db, "upload"), {
      timestamp: serverTimestamp(),
    });
    await Promise.all(
      selectedImage.map(image => {
        const imageRef = ref(storage, `upload/${docRef.id}/${image.path}`);
        uploadBytes(imageRef, image, "data_url").then(async () => {
          const downloadURL = await getDownloadURL(imageRef);
          await updateDoc(db, "upload", docRef.id),
            {
              image: arrayUnion(downloadURL),
            };
        });
      })
    );

    selectedImage([]);
  };

  const onDrop = useCallback(acceptedFiles => {
    setSelectedImage(
      acceptedFiles.map(file =>
        Object.assign(file, {
          preview: URL.createObjectURL(file),
        })
      )
    );
  }, []);
  const { getRootProps, getInputProps } = useDropzone({ onDrop });
  const selected_images = selectedImage.map((file) => (
    <div>
      <img src={file.preview} style={{ width: "200px" }} alt="" />
    </div>
  ));
  return (
    <div>
      <div {...getRootProps()}>
        <input {...getInputProps()} />
        <p>Drop the files here ...</p>
        <p>Drag 'n' drop some files here, or click to select files</p>
      </div>
      <button onClick={uploadPost}>Post</button>
      {selected_images}
    </div>
  );
}
